import React from 'react';
import './Main.css';

function MainPage() {
  return (
    <div className="App">

      <div className="content">
        <div className="main-page">
          <h1>메인 페이지</h1>
          <p>여기에 메인 페이지의 주요 내용을 작성하세요. 로그인 및 회원가입 페이지와 동일한 스타일을 사용합니다.</p>
          <button>자세히 보기</button>
        </div>
      </div>
    </div>
  );
}

export default MainPage;
